import React from 'react';
import monstera from "../images/plants/monstera.png";

const Cart_product = () => {
    return(
        <div style={{ backgroundColor: '#f1f1f1', borderRadius: '10px', width: '40%', padding: '20px', boxSizing: 'border-box' }}>
            <div className = "product" style={{ marginRight: '1rem' }}>
                <img src={monstera} alt={monstera} style={{ width: 'auto', height: '100%', objectFit: 'cover' }} />
            </div>
            <div>
                <div style={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Nome: Monstera</div>
                <div style={{ fontStyle: 'italic', marginBottom: '0.5rem' }}>Vendido por: Maria Florista</div>
                <center>
                <div><button style={{ width: '100%',marginTop: '10px',marginRight: '10px', backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer' }}>Informations</button></div>
                <div><button style={{ width: '100%',marginTop: '10px',marignLeft: '10px',backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer' }}>Visit seller</button></div>
                <div><button style={{ width: '100%',marginTop: '10px',marignLeft: '10px',backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer' }}>Add to cart</button></div>
                <div><button style={{ width: '100%',marginTop: '10px',marignLeft: '10px',backgroundColor: '#ff0000', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer' }}>Remove from favorites</button></div>
                </center>

            </div>
        </div>

        );
};

export default Cart_product;
